package com.jsp.studyShare.model;import java.util.Date;public class Data {    private int did;    private int cid;    private String dataName;    private String dataDesc;    private String dataFile;    private int status;    private String openid;    private Date uploadTime;    public int getDid() {        return did;    }    public void setDid(int did) {        this.did = did;    }    public int getCid() {        return cid;    }    public void setCid(int cid) {        this.cid = cid;    }    public String getDataName() {        return dataName;    }    public void setDataName(String dataName) {        this.dataName = dataName;    }    public String getDataDesc() {        return dataDesc;    }    public void setDataDesc(String dataDesc) {        this.dataDesc = dataDesc;    }    public String getDataFile() {        return dataFile;    }    public void setDataFile(String dataFile) {        this.dataFile = dataFile;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }    public String getOpenid() {        return openid;    }    public void setOpenid(String openid) {        this.openid = openid;    }    public Date getUploadTime() {        return uploadTime;    }    public void setUploadTime(Date uploadTime) {        this.uploadTime = uploadTime;    }}